document.addEventListener("DOMContentLoaded", function() {
    const { jsPDF } = window.jspdf;

    window.generarPDF = function() {
        const doc = new jsPDF();

        // Obtener los valores del formulario
        const nombre = document.getElementById('nombre').value;
        const dni = document.getElementById('dni').value;
        const obra = document.getElementById('obra').value;
        const ubicacion = document.getElementById('ubicacion').value;

        // Configuración de fuente
        doc.setFont("helvetica", "normal");
        doc.setFontSize(10);

        // Añadir el texto fijo
        doc.text("Las Termas de Río Hondo, 11 de Diciembre de 2024", 115, 25);
        doc.text("Al Intendente Municipal", 10, 60);
        doc.text("Jorge Alejandro Mukdise", 10, 70);
        doc.text("S________/_________D:", 10, 80);

        // Crear el contenido del párrafo
        const textoNormal = `El /La que suscribe, ${nombre}, DNI N° ${dni}. Me dirijo a ud. a los fines de solicitar `;
        const textoNegrita = `CAMBIO DE FACHADA Y POSTERIOR APROBACIÓN `;
        const textoResto = `de la Documentación Técnica que adjunta OBRA: ${obra} ubicada en ${ubicacion}`;

        // Dividir el texto en líneas ajustadas al ancho máximo
        const maxLineWidth = 180; // Ajusta el ancho máximo según tus necesidades
        const lineasTextoNormal = doc.splitTextToSize(textoNormal, maxLineWidth);
        const lineasTextoResto = doc.splitTextToSize(textoResto, maxLineWidth);

        // Posición inicial
        let y = 110;
        const lineHeight = 10;

        // Añadir el texto normal
        lineasTextoNormal.forEach(line => {
            doc.text(line, 60, y);
            y += lineHeight;
        });

        // Añadir el texto en negrita
        doc.setFont("helvetica", "bold");
        doc.text(textoNegrita, 10, y);
        y += lineHeight;

        // Añadir el resto del texto normal
        doc.setFont("helvetica", "normal");
        lineasTextoResto.forEach(line => {
            doc.text(line, 10, y);
            y += lineHeight;
        });

        // Añadir el logo al PDF
        const logo = {
            img:"data:image/png;base64,",
        }// Coloca tu imagen base64 aquí
        doc.addImage(logo.img, "PNG", 10, 10, 50, 30);

        // Guardar el PDF
        doc.save('notas.pdf');
    };
});
